import React from 'react';

//components
import TopicTag from './TopicTag';

const LeftFeed = () => {

    return (
        <div className="left-feed" >
            <div className="text-bold text-grey">Feeds</div>
            <TopicTag tagDetails={{ "icon": "#", "name": "Software Engineer" }} />
            <TopicTag tagDetails={{ "icon": "#", "name": "Job Search" }} />
            <TopicTag tagDetails={{ "icon": "#", "name": "Machine Learning" }} />
            <TopicTag tagDetails={{ "icon": "#", "name": "MBA Education" }} />
            <TopicTag tagDetails={{ "icon": "#", "name": "Software Engineer" }} />
            <TopicTag tagDetails={{ "icon": "#", "name": "yytware Engineer" }} />

        </div>
    )


}

export default LeftFeed;
